import React from 'react'
import { View, Text, Button } from 'react-native'

export default function HomeScreen( {navigation} ){
    return(
        <View>
            <Text>Home Screen</Text>
            <Button 
                title ='Go to Unit Screen'
                onPress ={() => navigation.navigate('HomeStack', {})}
            />
        </View>
    )
}
